import React, {Component} from 'react';
import './style/navChats.css';

class Nav extends Component{
    render(){
        return(
          <div className="sidebar2 active">
              <ul className="nav-list">
                <li>
                    <a href="#">
                        <i class='bx bx-world'></i>
                    </a>
                    <span className="tooltip">Buscar Trabajo</span>
                </li>
                <li>
                <a href="#">
                    <i class='bx bxs-to-top'></i>                
                    <span className="links_name">Publicar Trabajo</span>
                </a>
                <span className="tooltip">Publicar Trabajo</span>
                </li>
                <li>
                <a href="#">
                <i class='bx bxs-user'></i>
                <span className="links_name">Buscar Trabajador</span>
                </a>
                <span className="tooltip">Buscar Trabajador</span>
                </li>
                <li>
                <a href="#">
                <i class='bx bxs-user-check'></i>
                <span className="links_name">Aplicaciones</span>
                </a>
                <span className="tooltip">Aplicaciones</span>
                </li>
                <li>
                <a href="#">
                <i class='bx bxs-hot'></i>
                <span className="links_name">Planes Premium</span>
                </a>
                <span className="tooltip">Planes Premium</span>
                </li>                
             </ul>
          </div>
        )
    }


    btnActive(){
        let sidebar   = document.querySelector(".sidebar");
        sidebar.classList.toggle("active");
    }

    btnSearch(){
        let sidebar   = document.querySelector(".sidebar");
        sidebar.classList.toggle("active"); 
    }

}

export default Nav;
